import { CardMedia, Container,Grid, Typography } from "@material-ui/core";
import React from "react";
import logo from "../logo.jpeg";
const Report =()=>{
    return(
        <Container>
            <Grid container spacing={2}>
                <Grid item md={12}>
                <CardMedia
                    style={{height: 200, width: "50%"}}
                    component="img"
                    alt="Biossay"
                    height="auto"
                    image={logo}
                />
                </Grid>
                <Grid item md={12}>
                    <Typography variant="h5">REPORTE DE SERVICIO TÉCNICO</Typography>
                </Grid>
                <Grid item md={12}>
                    <Typography>REPORTE DE SERVICIO TÉCNICO</Typography>
                </Grid>
            </Grid>
        </Container>
    );
}

export default Report;
